import React, { Component } from "react";
import "../node_modules/react-vis/dist/style.css";

import {

  XYPlot,
  LineSeries,
  VerticalGridLines,
  HorizontalGridLines,
  XAxis,
  YAxis,


} from "react-vis";


class Connection2 extends Component {
    state = {
        value: false,
      };

    render() { 
        const data = [
            { x: 1, y: 0, color: 10 },
            { x: 1, y: 5, color: 10 },
            { x: 1, y: 10, color: 6 },
            { x: 1, y: 15, color: 7 },
            { x: 2, y: 0, color: 12 },
            { x: 2, y: 5, color: 2 },
            { x: 2, y: 10, color: 1 },
            { x: 2, y: 15, color: 12 },
            { x: 3, y: 0, color: 9 },
            { x: 3, y: 5, color: 2 },
            { x: 3, y: 10, color: 6 },
            { x: 3, y: 15, color: 12 },
          ];
        return (  <XYPlot height={300} width={700}>
            <VerticalGridLines />
            <HorizontalGridLines />
            <XAxis />
            <YAxis />
            <LineSeries data={data} />
          </XYPlot> );
    }
}

export default Connection2;
